import React, { useState, useEffect } from 'react'
import axios from 'axios'
import { useNavigate } from 'react-router-dom'

function Profile() {
    const [email, setEmail] = useState('')
    const [username, setUsername] = useState('')
    const [currentPassword, setCurrentPassword] = useState('')
    const [newPassword, setNewPassword] = useState('')
    const [user, setUser] = useState(null)
    const [loading, setLoading] = useState(true)
    const [error, setError] = useState(null)
    const navigate = useNavigate()

    useEffect(() => {
        // Fetch the user profile from the backend
        axios.get('http://localhost:3001/profile', {
            headers: {
                Authorization: `Bearer ${localStorage.getItem('token')}`
            }
        })
        .then((response) => {
            setUser(response.data)
            setEmail(response.data.email)
            setUsername(response.data.username)
            setLoading(false)
        })
        .catch((error) => {
            console.log('Error fetching user profile', error)
            setError('Error fetching user profile')
            setLoading(false)
        })
    }, [])

    const handleUpdateProfile = (event) => {
        event.preventDefault()
        setLoading(true)
        axios.put('http://localhost:3001/profile', { email, username }, {
            headers: {
                Authorization: `Bearer ${localStorage.getItem('token')}`
            }
        })
        .then((response) => {
            alert('Profile updated successfully')
            setLoading(false)
        })
        .catch((error) => {
            alert('Error updating profile')
            setLoading(false)
        })
    }

    const handleChangePassword = (event) => {
        event.preventDefault()
        setLoading(true)
        axios.post('http://localhost:3001/change-password', { currentPassword, newPassword }, {
            headers: {
                Authorization: `Bearer ${localStorage.getItem('token')}`
            }
        })
        .then((response) => {
            alert('Password updated successfully')
            setCurrentPassword('')
            setNewPassword('')
            setLoading(false)
            navigate('/login')
        })
        .catch((error) => {
            alert(error.response.data.error || 'Error updating password')
            setLoading(false)
        })
    }

    if (loading) return <div>Loading...</div>
    if (error) return <div>{error}</div>

    return (
        <div className='w-full h-screen flex'>
            <div className='w-[100%] h-[100%] bg-[#1a1a1a] text-white flex justify-center items-center'>
                <form className='text-center border rounded-lg w-[600px] h-[500px] p-9' onSubmit={handleUpdateProfile}>
                    <h2 className='mb-4'>Profile</h2>
                    {/* Email Input */}
                    <label>Email</label>
                    <br />
                    <input
                        className='w-[400px] h-[40px] rounded-xl bg-zinc-700 p-2'
                        type='email'
                        placeholder='Email'
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                    />
                    <br />
                    <br />
                    {/* Username Input */}
                    <label>Username</label>
                    <br />
                    <input
                        className='w-[400px] h-[40px] rounded-xl bg-zinc-700 p-2'
                        type='text'
                        placeholder='Username'
                        value={username}
                        onChange={(e) => setUsername(e.target.value)}
                    />
                    <br />
                    <br />
                    {/* Button */}
                    <button className='w-[200px] h-[50px] border hover:bg-teal-900' type='submit'>Update Profile</button>
                </form>
                <form className='text-center border rounded-lg w-[600px] h-[500px] p-9' onSubmit={handleChangePassword}>
                    <h2 className='mb-4'>Change Password</h2>
                    {/* Current Password Input */}
                    <label>Current Password</label>
                    <br />
                    <input
                        className='w-[400px] h-[40px] rounded-xl bg-zinc-700 p-2'
                        type='password'
                        placeholder='Current Password'
                        value={currentPassword}
                        onChange={(e) => setCurrentPassword(e.target.value)}
                    />
                    <br />
                    <br />
                    {/* New Password Input */}
                    <label>New Password</label>
                    <br />
                    <input
                        className='w-[400px] h-[40px] rounded-xl bg-zinc-700 p-2'
                        type='password'
                        placeholder='New Password'
                        value={newPassword}
                        onChange={(e) => setNewPassword(e.target.value)}
                    />
                    <br />
                    <br />
                    {/* Button */}
                    <button className='w-[200px] h-[50px] border hover:bg-teal-900' type='submit'>Change Password</button>
                </form>
            </div>
        </div>
    )
}

export default Profile
